import React, { useEffect, useState } from 'react';
import axios from '../api/axiosInstance';
import { useNavigate } from 'react-router-dom';
import '../App.css';

const AutoCreate: React.FC = () => {
  const [form, setForm] = useState({
    numeroPosti: 5,
    numeroPorte: 5,
    potenzaKw: '',
    cilindrata: '',
    consumoMedio: 0,
    annoImmatricolazione: new Date().getFullYear(),
    colore: '',
    marca: '',
    modello: '',
    targa: '',
    prezzo: 0,
    extTipoAlimentazioneId: '',
    extMotoreEuro: '',
    extTipoAuto: ''
  });
  interface MotoreEuroBean {
    motoreEuroId: number;
    descrizione: string;
  }
  
  const [alimentazioni, setAlimentazioni] = useState<any[]>([]);
  const [motori, setMotori] = useState<MotoreEuroBean[]>([]);
  const [tipiAuto, setTipiAuto] = useState<any[]>([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('/automezzi/findAllTipoAlimentazione').then(res => setAlimentazioni(res.data));
    axios.get('/automezzi/findAllMotoreEuro').then(res => setMotori(res.data));
    axios.get('/automezzi/findAllTipoAuto').then(res => setTipiAuto(res.data));
  }, []);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      const res = await axios.post('/automezzi/insertAuto', {
        autoBean: {
          numeroPosti: form.numeroPosti,
          numeroPorte: form.numeroPorte,
          potenzaKw: form.potenzaKw,
          cilindrata: form.cilindrata,
          consumoMedio: form.consumoMedio,
          extTipoAlimentazioneId: parseInt(form.extTipoAlimentazioneId),
          extMotoreEuro: parseInt(form.extMotoreEuro),
          extTipoAuto: parseInt(form.extTipoAuto)
        },
        mezzoBean: {
          modello: form.modello,
          marca: form.marca,
          targa: form.targa,
          colore: form.colore,
          prezzo: form.prezzo,
          annoImmatricolazione: form.annoImmatricolazione
        }
      });

      if (res.data.errorCode === 0) {
        alert('✅ Automezzo creato con successo');
        navigate('/');
      } else {
        alert(`❌ Errore: ${res.data.errorMessage}`);
      }
    } catch (err) {
      console.error(err);
      alert('Errore durante la creazione');
    }
  };

  return (
    <div className="form-container">
      <h2>Nuovo Automezzo</h2>
      <form onSubmit={handleSubmit} className="form">
        <input name="modello" placeholder="Modello" onChange={handleChange} required />
        <input name="marca" placeholder="Marca" onChange={handleChange} required />
        <input name="targa" placeholder="Targa" onChange={handleChange} required />
        <input name="colore" placeholder="Colore" onChange={handleChange} required />
        <input name="prezzo" type="number" placeholder="Prezzo" onChange={handleChange} required />
        <input name="annoImmatricolazione" type="number" placeholder="Anno Immatricolazione" onChange={handleChange} required />

        <input name="cilindrata" placeholder="Cilindrata" onChange={handleChange} required />
        <input name="potenzaKw" placeholder="Potenza Kw" onChange={handleChange} required />
        <input name="consumoMedio" type="number" step="0.1" placeholder="Consumo Medio" onChange={handleChange} required />
        <input name="numeroPorte" type="number" placeholder="Numero Porte" onChange={handleChange} required />
        <input name="numeroPosti" type="number" placeholder="Numero Posti" onChange={handleChange} required />

        <select name="extTipoAlimentazioneId" onChange={handleChange} required>
          <option value="">-- Seleziona Alimentazione --</option>
          {alimentazioni.map(al => (
            <option key={al.idTipoAlimentazione} value={al.idTipoAlimentazione}>{al.descrizione}</option>
          ))}
        </select>

        <select name="extMotoreEuro" onChange={handleChange} required>
          <option value="">-- Seleziona Motore Euro --</option>
          {motori.map(m => (
            <option key={m.motoreEuroId} value={m.motoreEuroId}>{m.descrizione}</option>
          ))}
        </select>

        <select name="extTipoAuto" onChange={handleChange} required>
          <option value="">-- Seleziona Tipo Auto --</option>
          {tipiAuto.map(t => (
            <option key={t.tipoAutoId} value={t.tipoAutoId}>{t.descrizione}</option>
          ))}
        </select>

        <button type="submit">Salva</button>
      </form>
    </div>
  );
};

export default AutoCreate;
